    return(
        <div className="create">
            <h1>Webform Creator</h1>
            <h3>Add or remove custom fields to complete your new webform.</h3>
            
            
            
            
            <br /><Link to="/">
                <button>Go Back</button>
                </Link>
        </div>
        
    );
}

export default Create
